import React from "react";

const UserData =(props) => {
    return (
        <table class="table">
  <thead>
    <tr>    
      <th scope="col">winner</th>
      <th scope="col">date"</th>
    </tr>
  </thead>
  <tbody>
      {
          props.data.map(row =>(
    <tr>
      <th scope="row">1</th>
        <td>Mark</td>
        <td>Mark</td>
      
    </tr>
          )
          )
}
</tbody>    

</table>
    )
}



export default UserData;
